import React from 'react';
import Document, { Head, Main, NextScript } from 'next/document';


export default class MyDocument extends Document {

  render() {

    return (
      <html>
        <Head>
          <style>
            {`body{ background: #282A36; color: #FFF} a{color: #CCC}`}
          </style>
        </Head>
        <body>
          <Main />
          <NextScript />
        </body>
      </html>
    )
  }
}
